Live From Space

Science Documentary hosted by Soledad O Brien, published by National Geographic in 2014 - English narration


Information
------------------------------

National Geographic: Live From Space
National Geographic Channel is taking viewers around the world-literally-in this spectacular 90-minute special television event, broadcasting LIVE from the International Space Station (ISS) and Mission Control in Houston, Texas. Made in collaboration with NASA, we'll go into orbit with astronauts Rick Mastracchio and Koichi Wakata as they fly at 17,500 mph nearly 250 miles above the earth's surface on the International Space Station, while astronaut Mike Massimino joins host Soledad O'Brien on the ground at Mission Control in Houston. From space, Mastracchio and Wakata will give viewers a fully guided tour, showing us how they live for months in microgravity. They'll conduct never-before-broadcast experiments that demonstrate the real-world value of the science conducted on the floating laboratory. Plus get ready for stunning shots of Earth, from sunset and sunrise, to city lights and green aurora, to lightning storms and shooting stars. You've never seen our planet like this before.

